<p>SDK (Software Development Kit)=软件开发工具包可用于开发面向特定平台的软件应用程序的工具包。举个例子，如果你想组装一个模型车或飞机。在构建这个模型时，需要一整套物品去组装。SDK相当于组装它们所需的工具，包括装配说明等等。</p>
